module.exports = "<div class=\"contain-wrapp \">\n    <div class=\"container \">\n        <header class=\"subpages_intro\">\n            <div class=\"custom_container\">\n                <div class=\"row\">\n                    <div class=\"col-sm-12\">\n                        <h1>Altcoin</h1>\n                    </div>\n                </div>\n            </div>\n        </header>\n        <section class=\"policy mt-md-3 mt-0 mb-2\">\n            <div class=\"custom_container\">\n                <p>There are over 1,300 cryptocurrencies in the world right now with more being introduced almost every day.\n                    The total value of digital currencies right now is just over $587 billion. Bitcoin is dominating the\n                    market with the market capitalization of a whopping $317 billion. Except Bitcoins, all other crypto coins\n                    are called Altcoins.</p>\n                <p>Ether is the second-largest digital currency with a market cap of $68.9 billion. Moreover, according to\n                    Peter Smith, the chief executive officer of Blockchain Ltd. By 2018 total valuation of cryptocurrencies\n                    will loom around <b>$1 trillion.</b></p>\n                <p>Leaving less popular Altcoins apart, let’s focus on the most popular players on the crypto stage – Bitcoin\n                    Cash, Ethereum, Ripple, Litecoin, Monero and Dash. These are well-positioned in the list of top ten cryptocurrencies\n                    and have attracted the plethora of investors across the globe. Let’s dig deep into each of them and find\n                    from where and how you can buy one. Let’s also find out the future speculation regarding their growth.</p>\n                <h4><b>How to Buy?</b></h4>\n                <p>One can buy these Altcoins in multiple ways. First, you can buy directly from another person who is holding\n                    any of these coins. The second option, which is the most preferable one, is to buy cryptocurrencies via\n                    crypto exchanges.</p>\n                <p>When it comes to other Altcoins, you can buy them from crypto exchanges such as NMCCX.</p>\n                <p>If you are just getting started with cryptocurrencies, NMCCX can be the ideal place to get your hands\n                    on Ethereum, Bitcoin Cash and Litecoin. When it comes to buying the rest of the coin, you can try Coinbase,\n                    Kraken, Gemini and Bittrex.</p>\n                <p>Though it is worth mentioning that, when you sign up for any of these exchanges, you will have to follow\n                    the relevant norms known as KYC (Know Your Customer) and AML (Anti-Money Laundering) regulations. That\n                    means you will have to upload government approved ID or residential proof or driving license for verification\n                    to prevent criminal activities that have been hovering around for a while.</p>\n                <p>Once you get through it, you can transfer the INR/USD to your exchange to buy any of these Altcoins.</p>\n                <p><b>Note:</b> Coinbase and Gemini only deal with the limited number of crypto coins.</p>\n                <h4><b>More About Altcoins</b></h4>\n                <p>Currently, all of the Altcoins mentioned above are well-positioned and consolidated its place as the top-tier\n                    cryptocurrencies.</p>\n                <h4><span class=\"curr_icon\">\n                        <img src=\"./assets/img/Re_ Coin icons/04.png\" class=\"img-fluid\" width=\"100%\" alt=\"\">\n                    </span><b>Ethereum</b></h4>\n                <p>The brainchild of Vitalik Buterin, the Ethereum is the second cryptocurrency with the largest market capital.\n                    Ethereum is also popular for the largest single crowdfunding effort where it generated $18,439,086, for\n                    a total of 60,102,216 ether in the form of Bitcoin. Since then, Ethereum never looked back. At the start\n                    of April 2017, ether was worth $50 per unit, implying returns over 160x in under three years. Today,\n                    Ethereum is popular for its versatile platform which is being used for smart contacts, token creation,\n                    Dapps and other applications. The future of Ethereum is quite promising.</p>\n                <h4><span class=\"curr_icon\">\n                        <img src=\"./assets/img/Re_ Coin icons/xrp_new.svg\" class=\"img-fluid\" width=\"100%\" alt=\"\">\n                    </span><b>Ripple</b></h4>\n                <p>Ripple is the world’s third-largest decentralized digital currency with a current market cap of $22,991,359,027\n                    USD. The founders of Ripple are Chris Larsen and Jed McCaleb. Ripple is a combination of cryptocurrency\n                    and digital transfer medium. Ripple Cryptocurrency is an open source technology with a shared and public\n                    database/ledger. Ripple network works on Ripple Transaction Protocol (RTXP) or simply Ripple Protocol.\n                    It enables you to transfer money securely and fast between banks or between payment providers and other\n                    financial institutes. Ripple supports Fiat, cryptocurrency and commodity for exchanges.</p>\n                <h4><span class=\"curr_icon\">\n                        <img src=\"./assets/img/Re_ Coin icons/03.png\" class=\"img-fluid\" width=\"100%\" alt=\"\">\n                    </span><b>Litecoin</b></h4>\n                <p>Known as Bitcoin’s elder cousin, Litecoin has earned its position as one of the top cryptocurrencies because\n                    of lower transaction fees and fast block interval time. Litecoin recently went down up to 35% due to\n                    the LTC foundation’s announcement of ceasing all operation and selling the LTC foundation on March 26,\n                    2018. That means LTC holders are upset, and it can affect the future price of LTC in a negative manner.</p>\n            </div>\n        </section>\n    </div>\n</div>"

