module.exports = "<div class=\"contain-wrapp \">\n  <div class=\"container \">\n    <header class=\"subpages_intro\">\n      <div class=\"custom_container\">\n        <div class=\"row\">\n          <div class=\"col-sm-12\">\n            <h1>FAQ's</h1>\n          </div>\n        </div>\n      </div>\n    </header>\n    <section class=\"policy mt-md-3 mt-0 mb-2\">\n      <div class=\"custom_container\">\n        <h5><b>Registration & KYC Process</b></h5>\n\n        <div class=\"row\">\n          <button data-toggle=\"collapse\" data-target=\"#demo1\" class=\"accordion user_content\"><i class=\"fa fa-plus-circle amlin \"></i>\n            1. Can I start trading on NMCCX without submitting KYC details?</button>\n          <div id=\"demo1\" class=\" collapse back\">\n            <p class=\"user_content left\">No. We need your KYC details to keep the trading platform fair and legitimate.</p>\n\n          </div>\n          <button data-toggle=\"collapse\" data-target=\"#demo2\" class=\"accordion user_content\"><i class=\"fa fa-plus-circle amlin \"></i>\n            2. What is required for KYC verification?</button>\n          <div id=\"demo2\" class=\" collapse back\">\n            <p class=\"user_content left\">PAN card, Aadhaar card, Photograph and GST Number(Not mandatory for Clients).</p>\n\n          </div>\n          <button data-toggle=\"collapse\" data-target=\"#demo3\" class=\"accordion user_content\"><i class=\"fa fa-plus-circle amlin \"></i>\n            3. I have PAN card, but I don’t have Aadhar card. Can I start trading?</button>\n          <div id=\"demo3\" class=\" collapse back\">\n            <p class=\"user_content left\">No. At this moment, Aadhaar card happens to be a mandatory document for all financial\n              transactions in India.</p>\n\n          </div>\n          <button data-toggle=\"collapse\" data-target=\"#demo4\" class=\"accordion user_content\"><i class=\"fa fa-plus-circle amlin \"></i>\n            4. I have Aadhar card, but I don’t have PAN card. Can I start trading?</button>\n          <div id=\"demo4\" class=\" collapse back\">\n            <p class=\"user_content left\">PAN is not required for creating an account on NMCCX. But, you can start trading\n              without submitting your PAN card details.</p>\n\n          </div>\n          <button data-toggle=\"collapse\" data-target=\"#demo5\" class=\"accordion user_content\"><i class=\"fa fa-plus-circle amlin \"></i>\n            5. Can I satrt trading on NMCCX without submitting GST number?</button>\n          <div id=\"demo5\" class=\" collapse back\">\n            <p class=\"user_content left\">Yes. You can! GST Number is mandatory for Trading Members (TM) and Professional\n              Clearing Member (PCM) only.</p>\n\n          </div>\n          <button data-toggle=\"collapse\" data-target=\"#demo6\" class=\"accordion user_content\"><i class=\"fa fa-plus-circle amlin \"></i>\n            6. Are my KYC documents safe with NMCCX?</button>\n          <div id=\"demo6\" class=\" collapse back\">\n            <p class=\"user_content left\">Absolutely. We give utmost importance to the safety of our users. The documents\n              are confidential and are never shared with any third party.</p>\n\n          </div>\n          <button data-toggle=\"collapse\" data-target=\"#demo7\" class=\"accordion user_content\"><i class=\"fa fa-plus-circle amlin \"></i>\n            7. My registration on NMCCX has been rejected. What now?</button>\n          <div id=\"demo7\" class=\" collapse back\">\n            <p class=\"user_content left\">You must have received a mail that clarifies why your application has been rejected.\n              Update your details according and try again.</p>\n\n          </div>\n          <button data-toggle=\"collapse\" data-target=\"#demo8\" class=\"accordion user_content\"><i class=\"fa fa-plus-circle amlin \"></i>\n            8. Is it possible to change my registered Email ID and/or Phone number attached to my account?</button>\n          <div id=\"demo8\" class=\" collapse back\">\n            <p class=\"user_content left\">No. If you somehow lose access to your email or phone, you have to suspend the present\n              account immediately and create a new account.</p>\n\n          </div>\n        </div>\n        <br>\n        <h5><b>Sign Up/Login</b></h5>\n        <div class=\"row\">\n          <button data-toggle=\"collapse\" data-target=\"#demo11\" class=\"accordion user_content\"><i class=\"fa fa-plus-circle amlin \"></i>\n            1. Can I use my Facebook/Google account to sign up for NMCCX?</button>\n          <div id=\"demo11\" class=\" collapse back\">\n            <p class=\"user_content left\">No. You can only use your email and phone number for the Sign Up process.</p>\n\n          </div>\n          <button data-toggle=\"collapse\" data-target=\"#demo12\" class=\"accordion user_content\"><i class=\"fa fa-plus-circle amlin \"></i>\n            2. I have signed up. But, I’m unable to start trading.</button>\n          <div id=\"demo12\" class=\" collapse back\">\n            <p class=\"user_content left\">You must verify your email and phone number before you may start trading. Click\n              on the verification link sent to your mail inbox to verify your email. Use the OTP sent to your mobile to verify\n              the mobile number and start trading right away.</p>\n\n          </div>\n          <button data-toggle=\"collapse\" data-target=\"#demo13\" class=\"accordion user_content\"><i class=\"fa fa-plus-circle amlin \"></i>\n            3. Can I change the registered email address?</button>\n          <div id=\"demo13\" class=\" collapse back\">\n            <p class=\"user_content left\">No. If you somehow lose access to your email, you have to suspend the present account\n              immediately and create a new account.</p>\n\n          </div>\n          <button data-toggle=\"collapse\" data-target=\"#demo14\" class=\"accordion user_content\"><i class=\"fa fa-plus-circle amlin \"></i>\n            4. I forgot my password. What to do now?</button>\n          <div id=\"demo14\" class=\" collapse back\">\n            <p class=\"user_content left\">Click on “Forget password.” We’ll send a link to your email so that you may save\n              a new password.</p>\n\n          </div>\n        </div>\n\n        <br>\n        <h5><b>Account</b></h5>\n        <div class=\"row\">\n          <button data-toggle=\"collapse\" data-target=\"#demo21\" class=\"accordion user_content\"><i class=\"fa fa-plus-circle amlin \"></i>\n            1. Am I allowed to have more than one account on NMCCX?</button>\n          <div id=\"demo21\" class=\" collapse back\">\n            <p class=\"user_content left\">No. Every account needs to go through a strict KYC verification process. So, it’s\n              technically impossible for one person to have more than one account.</p>\n\n          </div>\n\n        </div>\n\n        <br>\n        <h5><b>Fees</b></h5>\n        <div class=\"row\">\n          <button data-toggle=\"collapse\" data-target=\"#demo31\" class=\"accordion user_content\"><i class=\"fa fa-plus-circle amlin \"></i>\n            1. What’s your fee structure?</button>\n          <div id=\"demo31\" class=\" collapse back\">\n            <p class=\"user_content left\">Please visit this page to know our fee structure.</p>\n\n          </div>\n\n        </div>\n\n        <br>\n        <h5><b>Security</b></h5>\n        <div class=\"row\">\n          <button data-toggle=\"collapse\" data-target=\"#demo41\" class=\"accordion user_content\"><i class=\"fa fa-plus-circle amlin \"></i>\n            1. How safe is NMCCX?</button>\n          <div id=\"demo41\" class=\" collapse back\">\n            <p class=\"user_content left\">In terms of preserving your personal details, digital assets and wallets, NMCCX\n              is extremely secure. We use the most advanced technology to safeguard our users.</p>\n\n          </div>\n          <button data-toggle=\"collapse\" data-target=\"#demo42\" class=\"accordion\"><i class=\"fa fa-plus-circle amlin \"></i>\n            2. Not receiving OTP on my phone. What to do?</button>\n          <div id=\"demo42\" class=\" collapse back\">\n            <p class=\"user_content left\">There could be some delays due to network issues. Wait for some time, and you’ll\n              get it. If you still have issues, get in touch with us. But, it is highly important to go through the OTP verification\n              process to help us secure your wallet.</p>\n\n          </div>\n          <button data-toggle=\"collapse\" data-target=\"#demo43\" class=\"accordion\"><i class=\"fa fa-plus-circle amlin \"></i>\n            3. Is my wallet safe if I lose my phone?</button>\n          <div id=\"demo43\" class=\" collapse back\">\n            <p class=\"user_content left\">Absolutely. However, there is a risk of your credentials having been compromised.\n              We advise you to change your password at the earliest opportunity.</p>\n\n          </div>\n\n        </div>\n        <br>\n        <h5><b>Deposit and Withdrawa</b>l</h5>\n        <div class=\"row\">\n          <button data-toggle=\"collapse\" data-target=\"#demo51\" class=\"accordion\"><i class=\"fa fa-plus-circle amlin \"></i>\n            1. How to deposit cryptocurrencies on NMCCX?</button>\n          <div id=\"demo51\" class=\" collapse back\">\n            <p class=\"user_content left\">Login. Make sure your NMCCX profile is KYC verified. Click on “Profile” option and\n              then “Deposit Crypto.” Now, you can see the address of your wallet. Copy the address and paste it in the relevant\n              field of the other platform where you’re getting your coins from. You may also use the QR code to make the\n              process automated and error-free. Click “Send.” You should now see the cryptocoins in your NMCCX wallet.</p>\n\n          </div>\n          <button data-toggle=\"collapse\" data-target=\"#demo52\" class=\"accordion\"><i class=\"fa fa-plus-circle amlin \"></i>\n            2. What if I deposit my cryptocoins to a wrong address?</button>\n          <div id=\"demo52\" class=\" collapse back\">\n            <p class=\"user_content left\">There could be errors if you do it manually. That’s why we advise you to prefer\n              QR codes. Remember if you send your valuable cryptocurrencies to someone else’s wallet, it may be gone forever.\n              Be careful while you do the transactions.</p>\n\n          </div>\n          <button data-toggle=\"collapse\" data-target=\"#demo53\" class=\"accordion\"><i class=\"fa fa-plus-circle amlin \"></i>\n            3. I deposited coins to my wallet. But, it is not showing it.</button>\n          <div id=\"demo53\" class=\" collapse back\">\n            <p class=\"user_content left\">NMCCX supports only those wallets that belong to our exchange. If your transaction\n              has been confirmed in the blockchain, wait for two hours. If it still doesn’t show, get in touch with us.</p>\n\n          </div>\n          <button data-toggle=\"collapse\" data-target=\"#demo54\" class=\"accordion\"><i class=\"fa fa-plus-circle amlin \"></i>\n            4. Do you accept INR deposits?</button>\n          <div id=\"demo54\" class=\" collapse back\">\n            <p class=\"user_content left\">Yes, we do. Download our trading app so that you may get in touch with one of our\n              registered Trading Members (TM) to guide you through the process.</p>\n\n          </div>\n          <button data-toggle=\"collapse\" data-target=\"#demo55\" class=\"accordion\"><i class=\"fa fa-plus-circle amlin \"></i>\n            5. Are we allowed to redeem crypto assets to INR?</button>\n          <div id=\"demo55\" class=\" collapse back\">\n            <p class=\"user_content left\">Absolutely. Get our trading app to get in touch with one of our registered Trading\n              Members (TM) to initiate the process.</p>\n\n          </div>\n        </div>\n\n        <br>\n        <h5><b>Trading</b></h5>\n        <div class=\"row\">\n          <button data-toggle=\"collapse\" data-target=\"#demo61\" class=\"accordion\"><i class=\"fa fa-plus-circle amlin \"></i>\n            1. How can I trade on NMCCX?</button>\n          <div id=\"demo61\" class=\" collapse back\">\n            <p class=\"user_content left\">Get the mobile app to start trading with the help of a Trading Member (TM). You\n              may also trade on our website, if you want to trade Over The Counter. Please learn about the pros and cons\n              of these two different kinds of trading before you take any decision.</p>\n\n          </div>\n          <button data-toggle=\"collapse\" data-target=\"#demo62\" class=\"accordion\"><i class=\"fa fa-plus-circle amlin \"></i>\n            2. Should I take help of a Trading Member (TM) for trading?</button>\n          <div id=\"demo62\" class=\" collapse back\">\n            <p class=\"user_content left\">We recommend so. Trading is a complicated process, with high risks involved. Not\n              every Client has the technical expertise to trade on their own. Plus, the Trading Member (TM) will be there\n              whenever you need assistance in any trading-related work.</p>\n\n          </div>\n          <button data-toggle=\"collapse\" data-target=\"#demo63\" class=\"accordion\"><i class=\"fa fa-plus-circle amlin \"></i>\n            3. I want to trade Over The Counter with the company. Will you help me?</button>\n          <div id=\"demo63\" class=\" collapse back\">\n            <p class=\"user_content left\">We will. If you know what you are doing, go ahead and trade Over The Counter. Our\n              platform is all yours.</p>\n\n          </div>\n          <button data-toggle=\"collapse\" data-target=\"#demo64\" class=\"accordion\"><i class=\"fa fa-plus-circle amlin \"></i>\n            4. How do you decide the buying/selling rates on NMCCX?</button>\n          <div id=\"demo64\" class=\" collapse back\">\n            <p class=\"user_content left\">Our rates are in accordance with the present pricing structure accepted around the\n              world. It’s constantly changing. So, you may have to be on your toes all the time.</p>\n\n          </div>\n          <button data-toggle=\"collapse\" data-target=\"#demo65\" class=\"accordion user_content\"><i class=\"fa fa-plus-circle amlin \"></i>\n            5. Is there any NMCCX for trading?</button>\n          <div id=\"demo65\" class=\" collapse back\">\n            <p class=\"user_content left\">Certainly. Our Android/iOS apps are integral parts of the trading process on our\n              platform. Download the app now to start trading. </p>\n\n          </div>\n        </div>\n      </div>\n    </section>\n  </div>\n</div>"

