module.exports = "<div class=\"contain-wrapp \">\n  <div class=\"container \">\n    <header class=\"subpages_intro\">\n      <div class=\"custom_container\">\n        <div class=\"row\">\n          <div class=\"col-sm-12\">\n            <h1>About NMCCX</h1>\n          </div>\n        </div>\n      </div>\n    </header>\n    <section class=\"policy mt-md-3 mt-0 mb-2\">\n      <div class=\"custom_container\">\n        <div class=\"col-sm-12 company_image px-0 mb-3\">\n          <img src=\"./assets/img/company_2.jpg\" alt=\"\" width=\"100%\" class=\"img-fluid\">\n        </div>\n        <p>\n          <b>National Multi Crypto Currency Exchange (NMCCX) </b> is a crypto-to-crypto trading platform that conveniently\n          connects Clients with a team of verified and trained Trading Members(TM). We provide simplified technology, both\n          app-based and web-based, to help Clients select Trading Members(TM) near their geo-location. Our User Interface\n          is extremely easy-to-use and comes with optimum security to ensure the finest trading experience.</p>\n        <br>\n        <h1 class=\"section_title mt-0 mb-2\">The Mission</h1>\n        <div class=\"row\">\n          <div class=\"col-md-4  \">\n            <img src=\"./assets/img/the_mission.png\" alt=\"\" width=\"100%\" class=\"img-fluid \">\n          </div>\n\n          <div class=\"col-md-8\">\n            <p>\n              Our mission is to change the face of the Indian crypto economy by implementing blockchain technology across digital exchange\n              opportunities between Trading Members (TM) and Clients. In order to do that, we connect Clients, Trading Members\n              (TM) and Professional Clearing Members (PCM) through a verified network of Trading Members (TM) that is built\n              on absolute trust.\n            </p>\n          </div>\n        </div>\n        <br>\n        <h1 class=\"section_title mt-0 mb-2\">The Future</h1>\n        <div class=\"row\">\n          <div class=\"col-md-8\">\n            <p>\n              We believe that blockchain technologies are going to form the future of the global crypto economy. Make friends with cryptocurrency.\n              Be a part of this financial revolution.\n            </p>\n          </div>\n          <div class=\"col-md-4  \">\n            <img src=\"./assets/img/the-future.png\" alt=\"\" width=\"100%\" class=\"img-fluid \">\n          </div>\n        </div>\n      </div>\n    </section>\n\n  </div>\n</div>"

